import React from 'react'
import './NameHeader.css'

const NameHeader = () => {
    return (
        <div className="main">
            <div id="name-wrap">
                <img className="my-name" src="https://i.imgur.com/4Br6mmd.png"/>
                <h2>Front End Developer</h2>
                <h3>Lightstorm Entertainment</h3>
            </div>
        </div>
    )
}

export default NameHeader;
